INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130011, "ヤマト", 2, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 1, 3001, 3001100, 100, 2.1);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130011, "ヤマト", 2, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 4, 3001, 3001101, 101, 5.68);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130011, "ヤマト", 1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, 3001, 3001102, 102, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, 3002, 3002100, 100, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, 3002, 3002101, 101, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 2, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 5, 3002, 3002102, 102, 8.53);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 7, 3002, 3002103, 103, 5.67);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, 3002, 3002104, 104, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 3, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, 3004, 3002300, 300, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 7, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, 3005, 3002400, 301, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 1, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 2, 3003, 3003200, 200, 4.4);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 7, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, 3003, 3003201, 201, 0.0);
INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES (-416.5, 0.0, 130211, "フブキ", 2, "2024/10/31 12:00:00", "2030/01/01 14:59:59", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 1, 3003, 3003202, 202, 5.6);
